import 'bootstrap/dist/css/bootstrap.min.css';
import 'bootstrap/dist/js/bootstrap.bundle.min';
// import AddShoppingCartIcon from '@material-ui/core/AddShoppingCart';
import './App.css';


// install material icon: npm install @material-ui/core @material-ui/icons
function App() {
  return (
    <div className="App">
      <div className="navigation">
        <ul>
          <li><img src="logo.svg" /></li>
          <li><a href="/">Collections</a></li>
          <li><a href="/">Men</a></li>
          <li><a href="/">Women</a></li>
          <li><a href="/">About</a></li>
          <li><a href="/">Contact</a></li>
          <div className="right">
            <li><a href="/">
              {/* <AddShoppingCartIcon /> */}
            </a></li>
            <li><a href="/"><img src="image-avatar.png"/></a></li>
          </div>
        </ul>
      </div>
      <div className="row">
        <div className="col-6">
          <div><img src="image-product-1-thumbnail.jpg"/></div>
          <div className="flex">

          </div>
        </div>
        <div className="col-6"></div>
      </div>
    </div>
  );
}

export default App;
